import React from 'react';
import ReactDOM from 'react-dom';

class LineProducts extends React.Component {
    render(
    ) {
        return (
            <div className="products-container">
              <h1>LINEA DE PRODUCTOS</h1>
              <div className="info-products">
                  <div className="card-products">
                      <div className="circle">
                          <img src= "https://image.flaticon.com/icons/svg/1835/1835178.svg" />
                      </div>
                      <div className="info-card">
                         <h2>TUBERIAS</h2>
                         <p>Toda clase de Tubos en PVC, <br /> CPVC, Polietileno Liso y Corrugado.</p>
                         <a href="">MÃ¡s >></a>
                      </div>
                  </div>
                  </div>
              <style jsx>{`
              div,
              .products-container{
                // height: 100%;
                background-image: url('https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fjulianalauletta.files.wordpress.com%2F2011%2F11%2Fconcrete-4.jpg&f=1&nofb=1');
                background-repeat: no-repeat;
                background-size: cover;
              }
              h1{
                  height: 3rem;
                  background: pink;
              }

               
            
         `}</style>
            </div>
        )
    }
}
   
export default LineProducts;
